import React, {Component} from 'react';
import TodoItem from './TodoItem'
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
class TodoList extends Component {
    render() {
        return (
            <section>
                <h1> To do list</h1>
                <TodoItem/>
            </section>
        )
    }
}

export default TodoList;
